allow_embedding: false
db_schema:
  files:
    client: none
    columns:
    - admin_ui: {width: 200}
      name: path
      type: string
    - admin_ui: {width: 200}
      name: file
      type: media
    - admin_ui: {width: 200}
      name: file_version
      type: string
    server: full
    title: Files
dependencies: []
metadata: {logo_img: 'asset:IR_Logo.png', title: AYPYN}
name: Indian River MS After School Program Projects
native_deps:
  head_html: |
    <link href="https://fonts.googleapis.com/css2?family=Raleway:wght@400;600&display=swap" rel="stylesheet">
package_name: Indian_River_MS_After_School_Program_Projects
renamed: true
runtime_options:
  client_version: '3'
  server_spec: {base: python310-machine-learning}
  server_spec_disabled: {base: python310-standard, requirements: deepface}
  server_version: python3-sandbox
  version: 2
services:
- client_config: {}
  server_config: {}
  source: /runtime/services/tables.yml
- client_config: {}
  server_config: {file_table: files}
  source: /runtime/services/anvil/files.yml
startup: {module: Main, type: form}
startup_form: null
uplink_visible: true
